import "./App.css";
import Header from "./component/Header/Header";
import HomeMenu from "./component/HomeMenu/HomeMenu";

function App() {
  return (
    <div className="App">
      <div className="header">
        <Header />
      </div>
      <div className="content">
        <HomeMenu />
        <About />
      </div>
    </div>
  );
}

export default App;
